column8:
スタックボックスに積み上げて使えるシリーズです。<br>引出付きは、小物の整理に便利な2段タイプです。<br><br><br>●お客様組立品<br>※組立にはプラスドライバーが必要です。<br>●商品サイズ（cm）<br>本体：幅約40×奥行約28.7×高さ約30.5（取っ手を含まず）<br>引出し内寸：幅約33.9×奥行約23.7×高さ約9.3<br>●耐荷重<br>天板：約10kg<br>引き出し1個あたり：約3kg<br>全体：約16kg<br>●材質：プリント紙化粧パーティクルボード<br><style type="text/css">

